function trees_jscode_generate($trees_count = 7)
{
	global $trees_icons;

	if ($trees_count>1)
		$rand_trees_keys = array_rand($trees_icons, $trees_count);
	else
		$rand_trees_keys = array(array_rand($trees_icons, 1));

	$trees_for_user = array();

	for ($i=0; $i < $trees_count; $i++) { 
		$trees_for_user[] = $trees_icons[$rand_trees_keys[$i]];
	}

	return "let tree_icons = " . json_encode($trees_for_user) . ";";
}


